【商品説明】<BR>●煙臭くなく、優雅なバラの香りがする蚊とり線香です。<BR>●ピレスロイドを主成分とし、安定した殺虫効果を発揮します。<BR>●当社レギュラー品の1.7倍長持ちするジャンボサイズです。<BR>●上ブタが線香皿として使えてとても便利です。<BR><BR>商品サイズ：168×183×168<BR><BR>効能・効果：蚊成虫の駆除<BR><BR>成分：【有効成分】ｄｌ・ｄ-Ｔ80-アレスリン 【その他成分】デヒドロ酢酸ナトリウム、植物混合粉、香料、他3成分<BR><BR>ご使用上の注意等：【相談すること】 <BR>・万一身体に異常が起きた場合は、直ちに本品がピレスロイド系の殺虫剤であることを医師に告げて、診療を受けてください。 <BR>【その他の注意】 <BR>・閉め切った部屋やせまい部屋で使用すると、まれに目やのどに刺激を感じることもあるので、使用中は時々部屋を換気してください。 <BR>・アレルギー体質の人は使用に注意してください。 <BR>・火のついた蚊とり線香を燃えやすいものの上やそばに置かないでください。 <BR>・本品は必ず付属の線香皿でお使いください。 <BR>・使用回数が増えると、線香皿にヤニが付着し立ち消えのおそれがあります。定期的に中性洗剤を用いて洗い流し、よく乾燥させてから使用してください。 <BR>・線香皿の白いマットは不燃性のガラス繊維です。（アスベストではありません。）白いマットは取り外さずに、点火した線香をその上に直接置いて使用してください。 <BR>・缶の中に入っている丸ラベルの表示をよく読んで正しくお使いください。<BR><BR>・直射日光や湿気を避け、子供の手の届かない涼しいところに保管してください。<BR><BR>原産国：マレーシア<BR><BR>問い合わせ先：アース製薬株式会社 〒101-0048 東京都千代田区神田司町2-12-1 （お客様窓口)TEL0120-81-6456<BR>商品区分：防除用医薬部外品<BR>JANコード：4901080171818<br><br>【デング熱対策】<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
